class MapsActivity : AppCompatActivity(), OnMapReadyCallback {

    private var circle: Circle? = null
    private var fromLocation: Location? = null
    private var toLocation: Location? = null
    private var locationModel: LocationModel? = null
    private var typeAbsent: String = ""

    private lateinit var mMap: GoogleMap
    private lateinit var binding: ActivityMapsBinding
    private lateinit var fusedLocationClient: FusedLocationProviderClient
    private lateinit var locationRequest: LocationRequest
    private lateinit var locationCallback: LocationCallback

    private var listUserArea = ArrayList<UserArea>()
    private var latLng = ArrayList<LatLng>()
    private var toLocName = ArrayList<String>()
    private var yourRadius = ArrayList<Int>()
    private var fingerSN = ArrayList<String>()
    private var distance: Float = 1F

    @SuppressLint("SourceLockedOrientationActivity")
    override fun onCreate(savedInstanceState: Bundle?) {
        super.onCreate(savedInstanceState)

        binding = ActivityMapsBinding.inflate(layoutInflater)
        requestedOrientation = ActivityInfo.SCREEN_ORIENTATION_PORTRAIT
        setContentView(binding.root)

        val i = intent
        if (i != null) typeAbsent = i.getStringExtra(PARAM_TYPE_ABSENT).toString()
        @Suppress("DEPRECATION")
        if (i != null) listUserArea =
            i.getParcelableArrayListExtra(PARAM_LIST_USER_AREA) ?: ArrayList()
        println(listUserArea)

        if (supportActionBar != null) {
            supportActionBar?.title = "Absen $typeAbsent"
            supportActionBar?.setDisplayHomeAsUpEnabled(true)
            supportActionBar?.setHomeAsUpIndicator(R.drawable.btn_back)
        }

        setToLocation()

        // Obtain the SupportMapFragment and get notified when the map is ready to be used.
        val mapFragment = supportFragmentManager
            .findFragmentById(R.id.map) as SupportMapFragment
        mapFragment.getMapAsync(this)

        fusedLocationClient = LocationServices.getFusedLocationProviderClient(this)
    }

    private fun setToLocation() {
        toLocation = Location(LocationManager.GPS_PROVIDER)

        val imei = SharedPreference.getI(this)

        for (i in 0 until listUserArea.size) {
            toLocation?.latitude =
                listUserArea[i].area?.latitude_kantor?.toDouble() ?: -6.175141679262726
            toLocation?.longitude =
                listUserArea[i].area?.longitude_kantor?.toDouble() ?: 106.82713748710651

            latLng.add(
                LatLng(
                    listUserArea[i].area?.latitude_kantor?.toDouble() ?: -6.175141679262726,
                    listUserArea[i].area?.longitude_kantor?.toDouble() ?: 106.82713748710651
                )
            )
            toLocName.add(listUserArea[i].area?.deptname ?: "Lokasi Absensi")
            yourRadius.add(listUserArea[i].area?.radius_kantor ?: 10)
            fingerSN.add(listUserArea[i].area?.finger?.sn ?: imei.toString())
        }
    }

    /**
     * Manipulates the map once available.
     * This callback is triggered when the map is ready to be used.
     * This is where we can add markers or lines, add listeners or move the camera. In this case,
     * we just add a marker near Sydney, Australia.
     * If Google Play services is not installed on the device, the user will be prompted to install
     * it inside the SupportMapFragment. This method will only be triggered once the user has
     * installed Google Play services and returned to the app.
     */
    override fun onMapReady(googleMap: GoogleMap) {
        mMap = googleMap

        mMap.uiSettings.isZoomControlsEnabled = true
        mMap.uiSettings.isCompassEnabled = true
        mMap.mapType = MAP_TYPE_HYBRID

        getMyLastLocation()
        createLocationRequest()
        createLocationCallback()

        val firstLocation = latLng[0]

        val circleOptions = CircleOptions()
            .center(firstLocation)
            .radius(yourRadius[0].toDouble())
            .strokeWidth(5F)
            .fillColor(Color.argb(25, 255, 0, 0))
            .strokeColor(Color.RED)
        circle =
            mMap.addCircle(circleOptions.center(firstLocation).radius(yourRadius[0].toDouble()))

        mMap.addMarker(
            MarkerOptions()
                .position(firstLocation)
                .title("Kantor")
                .snippet(listUserArea[0].area?.finger?.alias)
        )
        mMap.animateCamera(CameraUpdateFactory.newLatLngZoom(circleOptions.center!!, 18F))
        mMap.moveCamera(CameraUpdateFactory.newLatLng(firstLocation))
    }

    /*@Override
    override fun onLocationChanged(location: Location) {
        val latLng = LatLng(location.latitude, location.longitude)

        mMap.animateCamera(CameraUpdateFactory.newLatLngZoom(latLng, 18F))
        fromLocation = location
        distance = location.distanceTo(toLocation ?: location)
        if (locationModel == null) {
            if (fromLocation != null) {
