            }
        }
        locationModel?.latitude = fromLocation?.latitude
        locationModel?.longitude = fromLocation?.longitude
        spinnerLocation()
    }*/

    private fun checkLocation(sn: String, radius: Double, mDistance: Float) {
        if (isLocationModelEmpty()) {
            Toast.makeText(
                applicationContext,
                "Lokasi Anda tidak ditemukan. Pastikan GPS Anda Aktif!",
                Toast.LENGTH_SHORT
            ).show()
        } else if (mDistance <= radius) {
            val i = Intent(this, FaceRecognitionActivityKotlin::class.java)
            i.putExtra(PARAM_TYPE_ABSENT, typeAbsent)
            i.putExtra(PARAM_DINAS_LUAR, false)
            i.putExtra(PARAM_LOCATION_MODEL, locationModel)
            i.putExtra("sn", sn)
            i.flags = Intent.FLAG_ACTIVITY_CLEAR_TOP
            startActivity(i)
            finish()
        } else {
            Toast.makeText(applicationContext, "Anda berada di luar Radius.", Toast.LENGTH_SHORT)
                .show()
        }
    }

    private fun isLocationModelEmpty(): Boolean {
        if (fromLocation != null) {
            if (locationModel == null) {
                locationModel = LocationModel(0.0, 0.0)
            }
            if (locationModel?.latitude == null) {
                locationModel?.latitude = fromLocation?.latitude
            }
            if (locationModel?.longitude == null) {
                locationModel?.longitude = fromLocation?.longitude
            }
        } else {
            return true
        }
        return false
    }

    private val requestPermissionLauncher =
        registerForActivityResult(
            ActivityResultContracts.RequestMultiplePermissions()
        ) { permissions ->
            when {
                permissions[Manifest.permission.ACCESS_FINE_LOCATION] ?: false -> {
                    getMyLastLocation()
                }

                permissions[Manifest.permission.ACCESS_COARSE_LOCATION] ?: false -> {
                    getMyLastLocation()
                }

                else -> {
                    // No location access granted.
                }
            }
        }

    private fun checkPermission(permission: String): Boolean {
        return ContextCompat.checkSelfPermission(
            this,
            permission
        ) == PackageManager.PERMISSION_GRANTED
    }

    private fun getMyLastLocation() {
        if (checkPermission(Manifest.permission.ACCESS_FINE_LOCATION) &&
            checkPermission(Manifest.permission.ACCESS_COARSE_LOCATION)
        ) {
            mMap.isMyLocationEnabled = true
            Log.e("isMyLocationEnabled", "true")
            fusedLocationClient.lastLocation.addOnSuccessListener { location: Location? ->
                if (location != null) {
                    startFromLocation(location)
                } else {
                    Toast.makeText(
                        this@MapsActivity,
                        "Lokasi tidak ditemukan. Coba Lagi!",
                        Toast.LENGTH_SHORT
                    ).show()
                }
            }
        } else {
            requestPermissionLauncher.launch(
                arrayOf(
                    Manifest.permission.ACCESS_FINE_LOCATION,
                    Manifest.permission.ACCESS_COARSE_LOCATION
                )
            )
        }
    }

    private fun startFromLocation(location: Location) {
        val startLocation = LatLng(location.latitude, location.longitude)
        mMap.moveCamera(CameraUpdateFactory.newLatLngZoom(startLocation, 18F))

        fromLocation = location
        distance = toLocation?.let { location.distanceTo(it) } ?: 1F

        if (locationModel == null) {
            if (fromLocation != null) {
                locationModel = LocationModel(0.0, 0.0)
            }
        }

        locationModel?.latitude = fromLocation?.latitude
        locationModel?.longitude = fromLocation?.longitude
        spinnerLocation()
    }

    private val resolutionLauncher =
        registerForActivityResult(
            ActivityResultContracts.StartIntentSenderForResult()
        ) { result ->
            when (result.resultCode) {
                RESULT_OK ->
                    Log.i(TAG, "onActivityResult: All location settings are satisfied.")

                RESULT_CANCELED ->
                    Toast.makeText(
                        this@MapsActivity,
                        "Anda harus mengaktifkan GPS untuk menggunakan aplikasi ini! \nTerima kasih",
                        Toast.LENGTH_SHORT
                    ).show()
            }
        }

    @Suppress("DEPRECATION")
    private fun createLocationRequest() {
        locationRequest = LocationRequest.create().apply {
            interval = TimeUnit.SECONDS.toMillis(1)
            maxWaitTime = TimeUnit.SECONDS.toMillis(1)
            priority = LocationRequest.PRIORITY_HIGH_ACCURACY
        }

        val builder = LocationSettingsRequest.Builder()
            .addLocationRequest(locationRequest)
        val client: SettingsClient = LocationServices.getSettingsClient(this)
        client.checkLocationSettings(builder.build())
            .addOnSuccessListener {
                getMyLastLocation()
            }
            .addOnFailureListener { exception ->
                if (exception is ResolvableApiException) {
                    try {
                        resolutionLauncher.launch(
                            IntentSenderRequest.Builder(exception.resolution).build()
                        )
                    } catch (sendEx: IntentSender.SendIntentException) {
                        Toast.makeText(this@MapsActivity, sendEx.message, Toast.LENGTH_SHORT).show()
                    }
                }
            }
    }

    private fun createLocationCallback() {
        locationCallback = object : LocationCallback() {
            override fun onLocationResult(locationResult: LocationResult) {
                locationResult.lastLocation
                for (location in locationResult.locations) {
                    Log.d(TAG, "onLocationResult: " + location.latitude + ", " + location.longitude)
                    val lastLatLng = LatLng(location.latitude, location.longitude)
                    mMap.animateCamera(CameraUpdateFactory.newLatLngZoom(lastLatLng, 18F))
                }
            }
        }
    }

    private fun startLocationUpdates() {
        try {
            fusedLocationClient.requestLocationUpdates(
                locationRequest,
                locationCallback,
                Looper.getMainLooper()
            )
        } catch (exception: SecurityException) {
            Log.e(TAG, "Error : " + exception.message)
        }
    }

    private fun stopLocationUpdates() {
        fusedLocationClient.removeLocationUpdates(locationCallback)
    }

    private fun spinnerLocation() {
        val adapter = ArrayAdapter(this, android.R.layout.simple_spinner_item, toLocName)
        adapter.setDropDownViewResource(android.R.layout.simple_spinner_dropdown_item)
        binding.spinnerLocation.adapter = adapter

        binding.spinnerLocation.onItemSelectedListener = object :
            AdapterView.OnItemSelectedListener {
            override fun onItemSelected(
                adapterView: AdapterView<*>?,
                view: View?,
                i: Int,
                id: Long
            ) {
                val nameLocation = adapterView?.getItemAtPosition(i) as String
                val selectLocation = latLng[i]
                mMap.clear()

                val valueRadius = yourRadius[i].toDouble()
                val valueSN = fingerSN[i]

                val circleOptions = CircleOptions()
                    .center(selectLocation)
                    .radius(valueRadius)
                    .strokeWidth(5F)
                    .fillColor(Color.argb(25, 255, 0, 0))
                    .strokeColor(ContextCompat.getColor(applicationContext, R.color.red))
                circle = mMap.addCircle(
                    circleOptions.center(selectLocation).radius(valueRadius)
                )

                mMap.addMarker(
                    MarkerOptions()
                        .position(selectLocation)
                        .title("Kantor")
                        .snippet(nameLocation)
                )
                mMap.animateCamera(CameraUpdateFactory.newLatLngZoom(selectLocation, 18F))

                toLocation?.latitude = selectLocation.latitude
                toLocation?.longitude = selectLocation.longitude

                binding.btnNext.setOnClickListener {
                    distance = toLocation?.let { fromLocation?.distanceTo(it) } ?: 1F
                    println("distance: $distance")

                    checkLocation(
                        valueSN,
                        valueRadius,
                        distance
                    )
                }
            }

            override fun onNothingSelected(adapterView: AdapterView<*>?) {

            }
        }
    }

    override fun onResume() {
        super.onResume()
        if (!isLocationModelEmpty()) {
            startLocationUpdates()
        }
    }

    override fun onPause() {
        super.onPause()
        stopLocationUpdates()
    }

    override fun onOptionsItemSelected(item: MenuItem): Boolean {
        if (item.itemId == android.R.id.home) {
            finish()
        }
        return super.onOptionsItemSelected(item)
    }

    companion object {
        private const val TAG = "MapsActivity"
    }
}

