class Result
{

    /*
     * Complete the 'superReducedString' function below.
     *
     * The function is expected to return a STRING.
     * The function accepts STRING s as parameter.
     */

    public static string superReducedString(string s)
    {
        const char nullChar = '\0';
        int len = s.Length;
        var startChar = nullChar;
        var endChar = nullChar;
        
        
        if(s.Length > 0)
        {
            startChar = s[0];
            s = s.TrimStart(startChar);
        }
        
        if(s.Length > 0)
        {
            endChar = s[s.Length-1];
            s = s.TrimEnd(endChar);
        }
        
        if(s.Length == 0)
        {
            (startChar, endChar) = (nullChar, nullChar);
        }
        
        int k = -1;
        // remove duplication in between
        for(int i = s.Length -1; i >= 0; i--)
        {
            if(k == -1)
            {
                k = i;
            }
            else
            {
                bool hit = false;
                while(i > 0 && s[i] == s[k]) 
                {
                    i--;
                    hit = true;
                }
                if(hit)i++;
                if(k-i > 0)
                {
                    // remove all but keep one char
                    s = s.Remove(i, k-i+1);
                }
                
                // reset main char tracker
                k = -1;
            }
        }
        
        if(startChar != nullChar)
        {
            s = startChar + s;
        }
        if(endChar != nullChar)
        {
            s = s + endChar;
        }
        
        // handle "aa" remaings
        if(s.Length > 1 && s[0] == s[1])
        {
            s = s.TrimStart(s[0]);
        }
        
        return string.IsNullOrEmpty(s) ? "Empty String" : s;
    }

}

class Solution
{
    public static void Main(string[] args)
    {
        TextWriter textWriter = new StreamWriter(@System.Environment.GetEnvironmentVariable("OUTPUT_PATH"), true);

        string s = Console.ReadLine();

        string result = Result.superReducedString(s);

        textWriter.WriteLine(result);

        textWriter.Flush();
        textWriter.Close();
    }
}

from functools import wraps
from queue import PriorityQueue
from time import time


class CacheClass:
    def __init__(self, duration):
        self.data = {}
        self.times = {}
        self.duration = duration
        self.time_queue = PriorityQueue()

    def cache(self, function):
        @wraps(function)
        def wrapper(*args, **kwargs):
            args_hash = hash(tuple([args, tuple(sorted(kwargs.items()))]))
            if args_hash in self.data:
                print('Use cache')
                return self.data[args_hash]

            print('Calculate cache')
            result = function(*args, **kwargs)
            self.data[args_hash] = result

            current_time = time()
            self.times[current_time] = args_hash
            self.time_queue.put(current_time)

            return result

        self.remove_old_values()

        return wrapper

    def remove_old_values(self):
        current_time = time()
        while not self.time_queue.empty() and self.time_queue.queue[0] + self.duration < current_time:
            deleted_time = self.time_queue.get()
            deleted_hash = self.times[deleted_time]
            self.times.pop(deleted_time)
            self.data.pop(deleted_hash)


@CacheClass(duration=60).cache
